import React from 'react';
import Cardlist from './Cardlist'
import robots from './robots'
import SearchBox from './SearchBox'

class App extends React.Component {
    constructor(){
        super()
        this.state = {
            robots: robots,
            searchfield: ''
        }
    }

    render(){
        return(
            <div>
                <h1>Robofriends</h1>
                <SearchBox/>
                <Cardlist robots = {robots}></Cardlist>
            </div>
        )

    }
};

export default App;
